import React from "react";
import { FaSearch } from "react-icons/fa"; // instalar react icon!
import { Link } from 'react-router-dom';
import './SearchBar.css'

function SearchBar(){

    const [name, setName] = useState('');

    function hanldeInputChange(e){
        e.preventDefault()
        setName(e.target.value)
        console.log('esto es lo que busco ->',name)
    }

    function handleSubmit(e){
        e.preventDefault();
    }


    return (
        <>
            <nav>
                <div>
                    <img className="logo" src={'#'} alt='logoDogs' />
                </div>
                <ul className="menu">
                    <div 
                        onClick={(e) => handleSubmit(e)}
                    >
                        <input 
                            // type='text' 
                            // placeholder='Buscar...'  
                            onChange={(e) => hanldeInputChange(e)}
                        />
                        
                        <button 
                            className="botonNav" 
                            type='submit' 
                            // onSubmit={(e) => handleSubmit(e)}
                        ><span><FaSearch/></span>Buscar</button>
                    </div>
                    {/* <li href='#' >inicio</li>
                    <li href='#' >inicio</li> */}
                    <Link to={'./creation'}>
                        <button className="botonNav">
                            Crea tu cachorro
                        </button>
                    </Link>
                </ul>
            </nav>
        </>
    )
}
export default SearchBar;
